//  ABA SERVIÇOS
// ════════════════════════════════════════════════════════════════════════════
function TabServicos() {
  const Grupo = ({ title, icon, items, isCombo = false }: { title: any; icon: any; items: any; isCombo?: any }) => (
    <div style={{ marginBottom:24 }}>
      <div style={{ display:"flex", alignItems:"center", gap:6, fontSize:10, fontWeight:700, letterSpacing:2, textTransform:"uppercase", color:C.gold, marginBottom:10, fontFamily:C.DM }}>
        <span>{icon}</span> {title}
        <div style={{ flex:1, height:1, background:`linear-gradient(to right,${C.goldD},transparent)` }} />
      </div>
      {items.map(s => (
        <div key={s.id} style={{ background:C.bg3, borderRadius:12, padding:"14px 16px", display:"flex", justifyContent:"space-between", alignItems:"center", marginBottom:8, border:"1px solid #2e2b24" }}>
          <div>
            <div style={{ fontSize:15, fontWeight:600, fontFamily:C.DM }}>{s.name}</div>
            <div style={{ fontSize:12, color:C.textD, marginTop:2, fontFamily:C.DM }}>{isCombo ? s.label : s.price}</div>
          </div>
          <div>
            {isCombo
              ? <div style={{ fontSize:17, fontWeight:800, color:C.gold, fontFamily:C.DM }}>R${s.price}</div>
              : <div style={{ fontSize:11, fontWeight:600, color:C.goldD, background:C.bg4, padding:"4px 12px", borderRadius:20, border:`1px solid ${C.goldD}`, fontFamily:C.DM }}>ver</div>
            }
          </div>
        </div>
      ))}
    </div>
  );

  return (
    <div style={{ background:C.bg, minHeight:"100%", padding:"24px 18px 40px", fontFamily:C.DM, color:C.text }}>
      <h1 style={{ fontSize:26, fontWeight:800, color:C.gold, marginBottom:4 }}>Serviços</h1>
      <p style={{ fontSize:12, fontWeight:500, color:C.textD, marginBottom:24, letterSpacing:2, textTransform:"uppercase" }}>Serviços Cadastrados</p>
      <Grupo title="Alinhamentos" icon="📏" items={SERVICOS.alinhamentos} />
      <Grupo title="Químicas"     icon="🖌️" items={SERVICOS.quimicas} />
      <Grupo title="Combos"       icon="%" items={COMBOS} isCombo />
    </div>
  );
}

